    return(
        <div className= "toast show" data-autohide='false'>

            <div className="toast-header">
                <strong className="mr-auto text-light">Message</strong>

                <button type="button" className="ml-2 mb-1 close " 
                data-dismiss="toast">x</button>
            </div>

            <div className="toast-body">Message</div>

        </div>
    )
}

export default Toast
